import React, { useState } from "react";

const AuthForm = () => {
  const [isSignIn, setIsSignIn] = useState(true);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [tipo, setTipo] = useState(""); // You will need to add this state for the tipo field if it's used for differentiating users

  const handleSubmit = async (event) => {
    event.preventDefault();
    const loginUrl = "http://localhost/Tarea3/backend/src/index.php/login";
    const professionalLoginUrl =
      "http://localhost/Tarea3/backend/src/index.php/loginProfessional";

    const endpoint = tipo === "professional" ? professionalLoginUrl : loginUrl;
    const loginData = { email, password };

    try {
      const response = await fetch(endpoint, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(loginData),
      });

      if (!response.ok)
        throw new Error(`HTTP error! status: ${response.status}`);
      const data = await response.json();
      console.log(data);
      // You would handle your login logic here, like redirecting the user or storing the login data
    } catch (error) {
      console.error("Login failed:", error);
    }
  };

  const toggleMode = () => {
    setIsSignIn(!isSignIn);
  };

  return (
    <div className="user-form-area ptb-100">
      <div className="container">
        <div className="user-item">
          <h2>{isSignIn ? "Sign In" : "Sign Up"}</h2>
          <form onSubmit={handleSubmit}>
            <div className="row">
              {!isSignIn && (
                <>
                  <div className="col-lg-12">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="First Name"
                        value={firstName}
                        onChange={(e) => setFirstName(e.target.value)}
                      />
                    </div>
                  </div>
                  <div className="col-lg-12">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="Last Name"
                        value={lastName}
                        onChange={(e) => setLastName(e.target.value)}
                      />
                    </div>
                  </div>
                </>
              )}
              <div className="col-lg-12">
                <div className="form-group">
                  <input
                    type={isSignIn ? "text" : "email"}
                    className="form-control"
                    placeholder={isSignIn ? "Email or Phone" : "Email"}
                    value={email}
                    onChange={(e) => setemail(e.target.value)}
                  />
                </div>
              </div>
              <div className="col-lg-12">
                <div className="form-group">
                  <input
                    type="password"
                    className="form-control"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </div>
              </div>
              {!isSignIn && (
                <div className="col-lg-12">
                  <div className="form-group">
                    <input
                      type="password"
                      className="form-control"
                      placeholder="Confirm Password"
                      value={confirmPassword}
                      onChange={(e) => setConfirmPassword(e.target.value)}
                    />
                  </div>
                </div>
              )}
              <div className="col-lg-12">
                <button type="submit" className="btn cmn-btn">
                  {isSignIn ? "Sign In" : "Sign Up"}
                </button>
                <span> Or </span>
                <button
                  type="button"
                  className="btn-toggle"
                  onClick={toggleMode}
                >
                  {isSignIn ? "Sign Up" : "Sign In"}
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default AuthForm;
